window.bookSummaryJSON = "<p>Based on the bestselling Audible Original by Anthony Khaseria, THE RATCATCHER is a thrilling police drama for fans of Joy Ellis and Michael Wood.</p> <p>It's been twelve weeks since Dresden Commissioner Paula Beyer was sent to the small town of Freidorf to investigate the disappearance of several teenagers. Now she is sitting opposite a psychologist who is tasked with figuring out whether Paula's statements about the case are true, or whether she needs to be suspended until further notice. While Paula believes that the young people were kidnapped by someone mimicking the legend of the Pied Piper of Hamelin, her colleagues believe that Paula is indulging in a fantasy and endangering the investigation.</p> <p>If Paula wants to stop the perpetrator, she has to convince the psychologist of her version of the story. But the longer the conversation goes on, the more Paula doubts herself…</p> <p>Starring Ayesha Antoine, Nicholas Asbury, Rachel Atkins, Lydia Brownell, Henry Calcutt, Patrick Campbell, Gunnar Cauthery, Harry Chalmers-Morris, Saffron Coomber, Clare Corbett, Phoebe Douglas, James Dryden, Tia Dutt, Raj Ghatak, Pete Gold, Corey Graham, Derek Griffiths, Malachi Hall, Leah Marks, Rachael Louise Miller, Niamh Marie Smith, , Kobna Holdbrook-Smith, Kyle McReynolds, Shogo Miyakita, Eva O’Hara, Dan Parr, Esme Patey-Ford, Travis Phillips, Nigel Pilkington, Penelope Rawlins, Enzo Squillino Jr, Annie Taylor, Cathy Tyson, Keith Wickham, Danny Horn, Matthew Woodyatt and Rufus Wright.</p> <p>Now available in Dolby Atmos on Audible.</p>"; 
